import React from "react";

function AllWishLists(props) {
  console.log("this is props  from AllWishLists", props);

  let things = props.saveFolder.map((d, i) => {
    return (
      <li key={i} onClick={() => props.handleClick(d)}>
        You have selected : {d.name} - Check in :{d.checkIn} - Check Out:
        {d.checkOut}
      </li>
    );
  });

  return (
    <div>
      <h2>Put these in your Wish</h2>
      <ul>{things}</ul>
    </div>
  );
}

export default AllWishLists;
